script: |
  super -f text -I q1833.spq | sort > q1833.out

inputs:
  - name: q1833.spq
    data: |
      SELECT - cor0.col2 / + tab0.col0 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
  - name: q1833.out
    data: |
      -1
      -1
      -1
      -2
      -2
      -2
      -4
      0
      0
